  true,\n\t\"url\": null,\n\t\"notes\": \"In this SBIR Phase I effort, Los Gatos Research
  (LGR) proposes tondevelop novel instrumentation based on laser absorption spectroscopyntechniques
  for ultrasensitive measurements of atomic and molecularnconcentrations as well as
  gas temperature and velocity in high enthalpynflows.  These autonomous instruments,
  based on high resolution lasernabsorption spectroscopy, will provide highly accurate,
  real-timenquantification of several important species and thus enable thenvalidation
  and refinement of numerical physical and chemical kineticnmodels, facilities diagnostics,
  and eventual development ofnnext-generation components and propulsion systems.   In
  Phase I, theninstrument will be fabricated and tested at LGR prior to integrationnonto
  a ground-based high enthalpy test facility at NASA Ames.  Thensystem will then be
  refined and delivered to a NASA test site.  FinalnPhase I work will involve developing
  a Phase II prototype capable ofnmaking in situ measurements of multiple parameters
  in aerothermodynamicsntest facilities.\",\n\t\"license_title\": \"U.S. Government
